import React from 'react';
import { Card, Tag, Avatar, Descriptions } from 'antd';
import { UserOutlined, EnvironmentOutlined, HeartOutlined } from '@ant-design/icons';

const MemberProfileCard = ({ profile }) => {
  return (
    <Card title="Member Profile" style={{ height: '100%' }}>
      <div style={{ textAlign: 'center', marginBottom: 24 }}>
        <Avatar size={64} icon={<UserOutlined />} style={{ backgroundColor: '#87d068' }} />
        <h3 style={{ margin: '12px 0 4px' }}>{profile.name}</h3>
        <p style={{ color: '#666', margin: 0 }}>{profile.occupation}</p>
      </div>

      <Descriptions column={1} size="small">
        <Descriptions.Item label="Age">{profile.age}</Descriptions.Item>
        <Descriptions.Item label="Location">
          <EnvironmentOutlined /> {profile.location}
        </Descriptions.Item>
        <Descriptions.Item label="Commitment">{profile.commitment}</Descriptions.Item>
        <Descriptions.Item label="Travel">{profile.travel_frequency}</Descriptions.Item>
      </Descriptions>

      <div style={{ marginTop: 16 }}>
        <div style={{ fontWeight: 'bold', marginBottom: 8 }}>Primary Goals:</div>
        {profile.primary_goals?.map((goal, index) => (
          <Tag key={index} color="blue" style={{ margin: '2px', display: 'block', marginBottom: 4 }}>
            {goal}
          </Tag>
        ))}
      </div>

      <div style={{ marginTop: 16 }}>
        <div style={{ fontWeight: 'bold', marginBottom: 8 }}>Health Conditions:</div>
        {profile.health_conditions?.map((condition, index) => (
          <Tag key={index} color="orange" style={{ margin: '2px' }}>
            <HeartOutlined /> {condition}
          </Tag>
        ))}
      </div>

      <div style={{ marginTop: 16 }}>
        <div style={{ fontWeight: 'bold', marginBottom: 8 }}>Support Team:</div>
        {profile.support_team?.map((member, index) => (
          <Tag key={index} color="green" style={{ margin: '2px' }}>
            {member}
          </Tag>
        ))}
      </div>
    </Card>
  );
};

export default MemberProfileCard;
